// import { BrowserRouter,Routes,Route } from 'react-router-dom';
import './App.css'; 

//pages & components
import Home from './pages/Home';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar/>
        <div className="pages">
          <Home/>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
